import React from "react";
//import { NavLink } from "react-router-dom"
import Home from './Home'; 

function NavBar(){

    return(
        <nav>
          <NavLink exact to="/"><Home/></NavLink> 
          <NavLink to="/addshow">AddShow</NavLink>
          <NavLink to="/shows">ShowCard</NavLink>
        </nav>
    );
}

export default NavBar;
